description:
The EMD SD70M is available in Southern Pacific livery and is also Quick Drive compatible, giving you the freedom to drive the Southern Pacific SD70M on any Quick Drive enabled route for Train Simulator. Also included are scenarios specifically for the Donner Pass route (available separately and required to play these scenarios).

IMPORTANT. The installation instructions are in the Readme.pdf. Also included is the link to our facebook fanpage.


Please support the developers and buy some of their content if you can afford it.


Please use the email address or the facebook fanpage for requests, questions and also if you want to share an addon with the community which we will post on your behalf.

If you would like to contribute, please read the Readme.pdf.


